import React from 'react';

const AwsCloudwatchResource = () => {
  return (
    <div className="aws-cloudwatch-resource">
      <h2>CloudWatch 메트릭 조회</h2>
      <p>CloudWatch 메트릭 조회 기능은 추후 확장 예정입니다.</p>
    </div>
  );
};

export default AwsCloudwatchResource;
